import React from 'react';
import styled from 'styled-components';

const FooterContainer = styled.footer`
  background-color: #000;
  color: #00f;
  padding: 10px;
  text-align: center;
  font-size: 14px;
  margin-top: auto;
`;

const Footer = () => {
  return (
    <FooterContainer>
      &copy; 2024 CodersBlog
    </FooterContainer>
  );
};
